    "contracts/token/Luna28.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity 0.8.21;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./ERC20.sol";
import "hardhat/console.sol";

contract Luna28 is Ownable, ERC20 {
  uint256 constant private BPS = 10_000;
  uint256 constant private DECIMALS = 10**uint256(18);
  uint256 constant public TAX = 200; // 2%
  uint256 constant public MAX_LUNA_PER_SWAP_DURING_FIRST_DAY = 2_800_000 * DECIMALS;

  uint32[2][] public lunarEvents;

  uint256 currentEventIndex = 0;
  uint256 minSwapAmount;
  address public moonCycleFund;
  uint256 whaleProtectionDeadline;

  // List of all dex pairs which $LUNA is part of
  mapping(address => bool) public dexPairs;
  mapping (address => bool) public isExluded;

  event PairAdded(address[] pairs);
  event PairRemoved(address[] pairs);
  event SwapAmountUpdated(uint256 oldSwapAmount, uint256 newSwapAmount);
  event NewLunarEvent(uint32 amount, uint32 date);

  constructor(
    address treasury,
    address _moonCycleFund,
    uint256 _minSwapAmount
  ) ERC20("Luna28", "LUNA") {
    _mint(treasury, 20_160_000_000 * DECIMALS);
    _mint(address(this), 7_840_000_000 * DECIMALS);

    moonCycleFund = _moonCycleFund;
    whaleProtectionDeadline = block.timestamp + 2 days;
    updateMinSwapAmount(_minSwapAmount);

    lunarEvents.push([140_000_000, 1711342396]); // 25 Mar 2024, 04:53:16 UTC
    lunarEvents.push([1_600_000_000, 1712590920]); // 8 Apr 2024, 15:42 UTC
    lunarEvents.push([525_000_000, 1726620067]); // 18 Sep 2024, 00:41:07 UTC
    lunarEvents.push([740_000_000, 1727883720]); // 2 Oct 2024, 15:42 UTC
    lunarEvents.push([190_000_000, 1729163449]); // 17 Oct 2024, 11:10:49 UTC
    lunarEvents.push([1_150_000_000, 1741924648]); // 14 Mar 2025, 03:57:28 UTC
    lunarEvents.push([350_000_000, 1743238200]); // 29 Mar 2025, 08:50 UTC
    lunarEvents.push([600_000_000, 1757258905]); // 7 Sep 2025, 15:28:25 UTC
    lunarEvents.push([350_000_000, 1758475740]); // 21 Sep 2025, 17:29 UTC
    lunarEvents.push([700_000_000, 1771322160]); // 17 Feb 2026, 09:56 UTC
    lunarEvents.push([520_000_000, 1772527465]); // 3 Mar 2026, 08:44:25 UTC
    lunarEvents.push([700_000_000, 1786548840]); // 12 Aug 2026, 15:34 UTC
    lunarEvents.push([275_000_000, 1787880238]); // 28 Aug 2026, 01:23:58 UTC
  }

  function updateMinSwapAmount(uint256 _minSwapAmount) public onlyOwner {
    emit SwapAmountUpdated(minSwapAmount, _minSwapAmount);
    minSwapAmount = _minSwapAmount;
  }

  function addLunarEvent(uint32 amount, uint32 date) external onlyOwner {
    lunarEvents.push([amount, date]);
    emit NewLunarEvent(amount, date);
  }

  function excludeMultiple(address[] memory accounts) external onlyOwner {
    for (uint256 i = 0; i < accounts.length; i++) {
      isExluded[accounts[i]] = true;
    }
  }

  function includeMultiple(address[] memory accounts) external onlyOwner {
    for (uint256 i = 0; i < accounts.length; i++) {
      isExluded[accounts[i]] = false;
    }
  }

  function addPairs(address[] calldata pairs) external onlyOwner {
    for (uint256 i = 0; i < pairs.length; i++) {
      dexPairs[pairs[i]] = true;
    }

    emit PairAdded(pairs);
  }

  function removePairs(address[] calldata pairs) external onlyOwner {
    for (uint256 i = 0; i < pairs.length; i++) {
      dexPairs[pairs[i]] = false;
    }

    emit PairRemoved(pairs);
  }

  function _transfer(address sender, address recipient, uint256 amount) internal override {
    require(sender != address(0), "ERC20: transfer from the zero address");
    require(recipient != address(0), "ERC20: transfer to the zero address");

    uint256 totalTax;
    uint256 burnAmount;
    uint256 moonCycleAmount;
    uint256 totalReceived;

    if(isExluded[sender]) {
      // send the full amount if sender is exlcuded
      totalReceived = amount;
    } else {
      totalTax = (amount * TAX) / BPS;
      burnAmount = totalTax / 2;
      moonCycleAmount = burnAmount;
      totalReceived = amount - totalTax;
    }

    uint256 senderBalance = _balances[sender];
    require(senderBalance >= amount, "ERC20: transfer amount exceeds balance");
    _balances[recipient] += totalReceived;

    if(totalTax > 0) {
      // remove 1% which will go to moonCycleFund and the other 1% will be burnt below
      // subtract the net amount (amount - tax) from the sender balance as well as the 1% moonCycleAmount
      // We can't subtract the burnAmount here because this will happen in the _burn function below
      unchecked {
        _balances[sender] = senderBalance - totalReceived - moonCycleAmount;
      }

      _balances[moonCycleFund] += moonCycleAmount;
      emit Transfer(sender, moonCycleFund, moonCycleAmount);

      // burn 1%
      _burn(sender, burnAmount);
    } else {
      unchecked {
        _balances[sender] = senderBalance - amount;
      }
    }

    // check LUNA swap on first day
    if(block.timestamp <= whaleProtectionDeadline && dexPairs[sender]) {
      require(amount <= MAX_LUNA_PER_SWAP_DURING_FIRST_DAY, "stay away Moby Dick");
    }

    // check if Lunar event and if it's a swap
    if(
      block.timestamp >= lunarEvents[currentEventIndex][1]
      && dexPairs[sender]
      && amount >= minSwapAmount
    ) {
      uint256 lunaAmount = lunarEvents[currentEventIndex][0] * DECIMALS;
      uint256 lunaReward = (lunaAmount * 1000) / BPS; // 10% goes to the lucky guy
      uint256 lunaBurn = lunaAmount - lunaReward;

      // transfer reward to the wallet that performed the swap
      _balances[recipient] += lunaReward;
      emit Transfer(address(this), recipient, lunaReward);

      // burn the remaining amount
      _burn(address(this), lunaBurn);

      currentEventIndex += 1; 
    }

    emit Transfer(sender, recipient, totalReceived);
  }
}
"
